    constructor(props) {
        super(props);

        this.state = {
            collections: Hat_Data

        }
    }

    render() {
        const { collections } = this.state;
        return <div className = "HatPage" > {
                collections.map(({ id, ...otherCollectionProps }) => ( <
                    Pre_Collection key = { id } {...otherCollectionProps }
                    />
                ))
            } <
            /div>
    }
}

export default HatPage;
